import React from "react";
import "../../css/cards/NoticeCard.css";
function NoticeCard(props) {
  return (
    <div className="notice-item">
      <p>{props.id}</p>
      <div>Q:{props.question}</div>
      <div>A:{props.answer}</div>
    </div>
  );
}

export default NoticeCard;
